import React from 'react';
import ReactDom from 'react-dom'
import './index.css';
// stateless functional component (must captialize the first character)
function App() {
  // return JSX/Html
  return (
    <React.Fragment>
      <h4>Title</h4>
      <section className='item'>
        <Item />
        <Item />
        <Item />
        <Item />
        <Item />
        <Item />
      </section>
    </React.Fragment>
  );
}

const Item = () => {
  return (
    <React.Fragment>
      <ItemName/>
      <ItemImage/>
    </React.Fragment>
  )
}

const ItemImage = () => {
  return (
    <img src="https://static.wikia.nocookie.net/minecraft_gamepedia/images/f/fc/Iron_Ingot_JE3_BE2.png" alt="iron.png" width="50" height="50"/>
  )
}

const ItemName = () => {
  return (
    <h2>
    Iron
    </h2>
  )
}
ReactDom.render(<App/>, document.getElementById('root'));
